import React from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import { Link } from 'react-router-dom';

const { Header, Content, Footer } = Layout;

const CustomLayout = (props) => {
    return (
        <Layout className="layout">
            <Header>
                <div className="logo" />
                <Menu
                    theme="dark"
                    mode="horizontal"
                    defaultSelectedKeys={['1']}
                    style={{ lineHeight: '64px' }}
                >
                    {
                        this.props.isAuthenticated ?
                            <Menu.Item key="1">Logout</Menu.Item>

                            :

                            <Menu.Item key="1"><Link to="/login">Login</Link></Menu.Item>

                    }
                    <Menu.Item key="2"><Link to="/play">Play</Link></Menu.Item>
                    <Menu.Item key="3"><Link to="/problems/">Problems</Link></Menu.Item>
                    <Menu.Item key="4"><Link to="/trophies/">Trophies</Link></Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>

                <div style={{ background: '#fff', padding: 24, minHeight: 280 }}>
                    {props.children}
                </div>
            </Content>
        </Layout>
    );
}


// <Breadcrumb style={{ margin: '16px 0' }}>
//<Breadcrumb.Item><Link to="/">Dashboard</Link></Breadcrumb.Item>
//<Breadcrumb.Item><Link to="/trophies/">Logout</Link></Breadcrumb.Item>
//</Breadcrumb>
export default CustomLayout;
